import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

// Images
import logo from "../assets/logo.jpg";
import necklace from "../assets/everyday-necklace1.jpg";
import earrings from "../assets/everyday-earring1.jpg";
import ring from "../assets/everyday-ring1.jpg";
import bracelet from "../assets/everyday-bracelet1.jpg";

const BridalCollection = () => {
  const navigate = useNavigate();
  const [search, setSearch] = useState("");

  const items = [
    { name: "Necklace", img: necklace },
    { name: "Earrings", img: earrings },
    { name: "Ring", img: ring },
    { name: "Bracelet", img: bracelet },
  ];

  const filtered = items.filter((item) =>
    item.name.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="home-container">
      {/* Header */}
      <header className="navbar">
        <div className="logo">
          <img src={logo} alt="Elegant Jewelry Logo" className="logo-img" />
          <span className="brand-name">Elegant Jewelry</span>
        </div>
        <ul className="nav-links">
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/collections">Collections</a></li>
          <li><a href="/orders">Orders</a></li>
          <li><a href="/wishlist">Wishlist</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </header>

      {/* Intro Text */}
      <div style={{ textAlign: "center", margin: "30px 20px" }}>
        <h2>Bridal Collection</h2>
        <p style={{ fontSize: "16px", color: "#555" }}>
          Explore stunning bridal jewelry — necklaces, earrings, rings, bracelets.
        </p>
      </div>

      {/* Search Bar */}
      <div className="search-bar" style={{ textAlign: "center", margin: "20px 0 40px 0" }}>
        <input
          type="text"
          placeholder="Search Bridal Collection..."
          value={search}
          onChange={(e) => setSearch(e.target.value)}
          style={{
            padding: "10px 20px",
            borderRadius: "25px",
            border: "2px solid #d6336c",
            width: "260px",
            outline: "none",
            fontSize: "15px",
          }}
        />
      </div>

      {/* Bridal Collection Section */}
      <section className="collections-section">
        <div
          className="collections-grid"
          style={{
            display: "flex",
            gap: "30px",
            flexWrap: "wrap",
            justifyContent: "center",
          }}
        >
          {filtered.map((item, index) => (
            <div
              key={index}
              className="collection-card"
              style={{ textAlign: "center", width: "220px" }}
            >
              <img
                src={item.img}
                alt={item.name}
                style={{ width: "100%", borderRadius: "10px" }}
              />
              <h3 style={{ marginTop: "10px", fontWeight: "bold" }}>{item.name}</h3>
              <button
                onClick={() => alert(`Explore ${item.name}`)}
                style={{
                  marginTop: "10px",
                  padding: "8px 20px",
                  borderRadius: "20px",
                  border: "none",
                  backgroundColor: "#d6336c",
                  color: "#fff",
                  cursor: "pointer",
                  fontWeight: "500",
                }}
              >
                Explore
              </button>
            </div>
          ))}
        </div>
      </section>

      {/* Footer */}
      <footer
        className="site-footer"
        style={{
          backgroundColor: "#000",
          color: "#fff",
          padding: "20px 0",
          textAlign: "center",
          marginTop: "50px",
        }}
      >
        <p>© 2025 Elegant Jewelry. All Rights Reserved.</p>
      </footer>
    </div>
  );
};

export default BridalCollection;
